import React, { Component } from 'react';
import './Navbar.css';

class Navbar extends Component {
    state = { clicked: false }

    handleClick = () => {
        this.setState({clicked: !this.state.clicked})
    }

    render() {
        return (
            <nav className="navbar">
                <a href="/" className="navbar__logo">ALIEN</a>
                <div className="navbar__bars"><i class="fas fa-bars"></i></div>
                <div className="navbar__menu">
                    <a href="/" className="navbar__menu--links">Home</a>
                    <a href="/" className="navbar__menu--links">Products</a>
                    <a href="/" className="navbar__menu--links">Services</a>
                    <a href="/" className="navbar__menu--links" onClick={this.handleClick} id="button">Sign Up</a>
                </div>
            </nav>
        );
    }

}

export default Navbar;
